def update_many(self, condition: dict, **kwargs) -> int:
    documents = self._get_collection()
    if not condition:
        return 0
    updated_count = 0
    for d in documents:
        for k, v in condition.items():
            if d.get(k) != v:
                break
        else:
            updated_count += 1
            for new_k, new_v in kwargs.items():
                d[new_k] = new_v
    if updated_count:
        self._write_collection(documents)
    return updated_count

